    "## Question 4.1\n",
    "### Describe a situation or problem from your job, everyday life, current events, etc., for which a clustering model would be appropriate. List some (up to 5) predictors that you might use.\n",
    "\n",
    "At my job in the supply chain industry, we are currently working to expand our business by either purchasing already constructed warehouses or purchasing land to build them ourselves. A clustering model would be appropriate to use in this situation to help determine the best location to purchase or build by utilizing some predictors such as capacity (land size), travel time to major roadways, population size, travel time to retail locations, purchasing cost, and operating costs (property taxes, utilities, maintenance, etc.)"
   ]
