   "source": [
    "#Identify the # of each species in our dataset\n",
    "table(iris_data$Species)\n",
    "\n",
    "#Simplify table for k_means model by selecting only the numerical columns\n",
    "iris <- iris_data[,1:4]\n",
    "\n",
    "#Visualize the data based on the predictors sepal length and speal width with the species colored\n",
    "ggplot(data = iris_data,aes(Sepal.Length, Sepal.Width, color = Species)) + geom_point()"
   ]
  },
