   "source": [
    "#Here will group the data into two clusters (centers = 2). The kmeans function also has an nstart option that attempts multiple initial configurations and reports on the best one. For example, adding nstart = 25 will generate 25 initial configurations. This approach is often recommended.\n",
    "k2 <- kmeans(iris, centers = 2, nstart = 25)\n",
    "str(k2)"
   ]
