   "source": [
    "The output of kmeans is a list with several bits of information. The most important being:\n",
    "\n",
    "cluster: A vector of integers (from 1:k) indicating the cluster to which each point is allocated.\n",
    "\n",
    "centers: A matrix of cluster centers.\n",
    "\n",
    "totss: The total sum of squares.\n",
    "\n",
    "withinss: Vector of within-cluster sum of squares, one component per cluster.\n",
    "\n",
    "tot.withinss: Total within-cluster sum of squares, i.e. sum(withinss).\n",
    "\n",
    "betweenss: The between-cluster sum of squares, i.e. $totss-tot.withinss$.\n",
    "\n",
    "size: The number of points in each cluster.\n",
    "\n",
    "If we print the results we’ll see that our groupings resulted in 2 cluster sizes of 50 and 100 and the cluster centers (means) for the two groups across the four variables (\"Sepal.Length\" \"Sepal.Width\" \"Petal.Length\" \"Petal.Width\"). We also get the index cluster assignment for each observation in the dataset."
   ]
