   "source": [
    "k3 <- kmeans(iris, centers = 3, nstart = 25)\n",
    "k4 <- kmeans(iris, centers = 4, nstart = 25)\n",
    "k5 <- kmeans(iris, centers = 5, nstart = 25)\n",
    "k6 <- kmeans(iris, centers = 6, nstart = 25)\n",
    "\n",
    "# plots to compare\n",
    "plot2 <- fviz_cluster(k2, geom = \"point\", data = iris) + ggtitle(\"k = 2\")\n",
    "plot3 <- fviz_cluster(k3, geom = \"point\",  data = iris) + ggtitle(\"k = 3\")\n",
    "plot4 <- fviz_cluster(k4, geom = \"point\",  data = iris) + ggtitle(\"k = 4\")\n",
    "plot5 <- fviz_cluster(k5, geom = \"point\",  data = iris) + ggtitle(\"k = 5\")\n",
    "plot6 <- fviz_cluster(k6, geom = \"point\",  data = iris) + ggtitle(\"k = 6\")\n",
    "\n",
    "library(gridExtra)\n",
    "grid.arrange(plot2, plot3, plot4, plot5, plot6, nrow = 2)"
   ]
