   "source": [
    "This visualization allows us to see where the dilineation occurs between clusters (or does not occur such as clusters 1 & 2 in the k = 6 graph), it does not tell us what the optimal number of clusters is. Thus, we're going to employ two popular methods for determining the optimal clusters:\n",
    "\n",
    "1. Elbow method- compute the k-means clustering algorithm for several different k values, then calculate the total within-cluster sum of square (wss), plot the curve of wss curve for each value of k, and identify where the \"bend\" in the plot is which indicates the correct # of clusters\n",
    "\n",
    "2. Silhouette method- compute the average silhouette of observations for several different k values (determines how well each datapoint lies within its cluster) and the best cluster k is the one that maximizes the average silhouette over all the different values of k test"
   ]
  },
