   "source": [
    "The Elbow method appears to indicate that 3 is the optimal number of clusters, while the Silhouette method shows that 2 is the optimal number of clusters. However since we're trying to predict 3 different flower species, we're going to stick with the Elbow method of 3 clusters and create several models with different predictors to determine which more correctly predicts species."
   ]
