   "source": [
    "#Using Sepal Length, Sepal Width, and Petal Length\n",
    "cluster_1 <- kmeans(iris_data[,1:3], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Length and Sepal Width\n",
    "cluster_2 <- kmeans(iris_data[,1:2], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Petal Length and Petal Width\n",
    "cluster_3 <- kmeans(iris_data[,3:4], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Width, Petal Length, and Petal Width\n",
    "cluster_4 <- kmeans(iris_data[,2:4], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Length, Petal Length, and Petal Width\n",
    "cluster_5 <- kmeans(iris_data[,c(1, 3:4)], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Length and Petal Length\n",
    "cluster_6 <- kmeans(iris_data[,c(1,3)], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Length and Petal Width\n",
    "cluster_7 <- kmeans(iris_data[,c(1,4)], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Width and Petal Length\n",
    "cluster_8 <- kmeans(iris_data[,2:3], centers = 3, nstart = 25)\n",
    "\n",
    "#Using Sepal Width and Petal Width\n",
    "cluster_9 <- kmeans(iris_data[,c(2,4)], centers = 3, nstart = 25)"
   ]
