   "source": [
    "Comparing the results of all the models above to the true classification given the model, it appears that model that performs best in predicting flower type is Cluster 3 which only consists of Petal Length and Petal Width predictors and a cluster of k = 3. While Cluster Model 9 has the lowest Total within-cluster sum of squares, the distance of each cluster from the next is relatively small and thus I would worry about classifying a datapoint into an incorrect cluster. The below visualization of model 3 with the datapoints based on Petal Length and Petal Width does show 3 clearly defined clusters for each species. Thus, I would choose my best model with k = 3, predictor variables of Petal Length and Petal Width, and end up with results of all 50 setosa species in cluster 1, 48 out of 50 versicolor species in cluster 2, and 46 out of 50 virginica species in cluster 3."
   ]
