   "source": [
    "Our p-value in the above is not less than 0.05, so I'm not inclined to reject the null hypothesis and conclude that the highest value of 1993 is an outlier. Given the Grubbs test, the lower the p-value the more statistically significant it would be that the value identified is an outlier. Generally speaking in statistics, we consider a p-value of less than or equal to 0.05 significant and a p-value greater than 0.05 to mean no effect (no outlier) observed. If we want to call our significance threshold 0.1 for this problem, we would consider 1993 an outlier."
   ]
  },
