       "\n",
       "\tGrubbs test for one outlier\n",
       "\n",
       "data:  us_crime$Crime\n",
       "G = 1.45589, U = 0.95292, p-value = 1\n",
       "alternative hypothesis: lowest value 342 is an outlier\n"
      ]
