     "output_type": "display_data"
    }
   ],
   "source": [
    "#Reverse of the above outlier check. Opposite = TRUE indicates that we're searching for the value with the largest difference from the mean on the opposite end of the tail. Type = 10 indicates we're checking the dataset for one outlier by calculating the score of this outlier G (outlier minus mean and divided by sd) and comparing it to appropriate critical values. The obtained value called U is bound with G by simple formula.\n",
    "\n",
    "grubbs.test(us_crime$Crime, type = 10, opposite = TRUE, two.sided = FALSE)"
   ]
  },
