   },
   "source": [
    "Running the Grubbs test again on the opposite tail to see if we have an outlier, we identify 342 as a potential outlier. However, the p-value of 1 indicates that there is no way that the null hypothesis (342 is not an outlier) is false.  1 minus the P value is the probability that the alternative hypothesis is true, and in this case 1 less our p-value equates to 0% probability that 342 is an outlier."
   ]
