    "## Question 6.1\n",
    "### Describe a situation or problem from your job, everyday life, current events, etc., for which a Change Detection model would be appropriate. Applying the CUSUM technique, how would you choose the critical value and the threshold?\n",
    "\n",
    "I work in the grocery supply chain industry and change detection models are vital in keeping our product levels in our warehouses at the necessary level to fulfill our retail store orders but not over our capacity limit that could hinder productivity/worker safety or create unnecessary food waste. We are constantly evaluating how much we have tied up in inventory dollars (on a weekly if not daily basis) to ensure our customers receive the best service level possible at the best price without overcrowding our warehouses, and if we're seeing an increase/decrease in product over time, we're evaluating it against demand to determine the root cause of the change and if we need to intervene. Some examples that could change inventory levels from one day to the next include supplier allocations on products (the good old 2020 toilet paper shortage, the 2021 cream cheese shortage, etc.), inflationary costs, buyers purchasing more product than we have demand, animal illnesses such as swine/avian flu, and so much more.\n",
    "\n",
    "From experience over 100+ years, we have learned that an in-service level below 75%--how much product we have available in the DC for that category based on the capacity within the warehouse that its granted--results in us being unable to fulfill all our stores' orders. My threshold has been preset by  my company, and we have found that we do not run into an issue with fulfilling store orders if the in service level is within a 5% variance  of desired in-stock level. We sometimes tweak these models based on the holidays and average demand in the warehouse, but for the most part our threshold stays constant. In determine a critical value, again my company has found that 5% is a safe bet but really we should also be evaluating this for every product category so that our model is less sensitive to changes given the high variability of product availability and wanting to avoid ordering too much product if we think we’re below our necessary service level. Again this is so important because we need to act quickly to keep our supply constant and determine if we need to find alternative sources for product or are we potentially going to waste a large amount of product due to an ill-timed purchase. "
   ]
