    "#Melting table so that all column headers are now rows in one column\n",
    "library(reshape)\n",
    "melted_temps <- melt(temps, id=c(\"DAY\"))\n",
    "\n",
    "#A very quick look at temperatures for every day in our dataset ranging from years 1996 to 2015\n",
    "ggplot(data = melted_temps, aes(x = interaction(variable, DAY, lex.order = TRUE), \n",
    "                                y = value, group = 1)) + geom_line(colour = \"blue\")"
   ]
  },
