   "source": [
    "#Calculating the average temperature for each day across all the rows\n",
    "library(matrixStats)\n",
    "temps$avg_temp <- rowMeans(temps[,c(2:21)])\n",
    "temps$sd_temp <- rowSds(as.matrix(temps[,c(2:21)]))\n",
    "\n",
    "#Calculating the average temperature of the new time series we created (avg_temp) which comes to ~83.34 degrees. The average standard deviation of temperature for a day year over year is ~5.43 degrees\n",
    "total_avg <- mean(temps$avg_temp)\n",
    "total_sd <- mean(temps$sd_temp)\n",
    "\n",
    "total_avg\n",
    "total_sd"
   ]
  },
