   "source": [
    "#Now lets look at a graph of our time series trend of the average temperature for each day vs the average temperature for the entire dataset\n",
    "ggplot(data = temps, aes(x = DAY, y = avg_temp, group = 1)) + geom_line(colour = \"blue\") +geom_hline(yintercept = mean(temps$avg_temp), color=\"red\")"
   ]
