   "source": [
    "#From our graph we can see that the temperatures really begin to dip below the average \"summer\" temperature of 83.34 dgrees around mid-September. Below zooms in on the specific part of our line graphp showing the dip.\n",
    "ggplot(data = temps[70:80,], aes(x = DAY, y = avg_temp, group = 1)) + geom_line(colour = \"blue\") +geom_hline(yintercept = mean(temps$avg_temp), color=\"red\")"
   ]
  },
