   "source": [
    "# set C\n",
    "C <- total_sd\n",
    "# compute the difference between the mean of the time series and each \"day\" and C\n",
    "St <- temps$avg_temp - total_avg - C\n",
    "# create an empty vector for looping\n",
    "# include an additional zero to help with indexing\n",
    "cumsum <- append(0 * St, 0)\n",
    "# loop through each day, check the cumulative sum, update the \n",
    "# index of our accumulator with the appropriate value\n",
    "for (i in 1:length(St)) \n",
    "     {\n",
    "  checker <- cumsum[i] + St[i]\n",
    "  \n",
    "  ifelse(checker > 0, cumsum[i+1] <- checker, cumsum[i+1] <- 0) \n",
    "}\n",
    "plot(cumsum)"
   ]
  },
