   "source": [
    "According to my CUMSUM model, the \"unofficial\" end of summer in Atlanta is the end of August, specifically August 23 in my model's case. This is quite ironic if you consider that the Fall 2022 semester begins on August 22, 2022 which is almost exactly the same as my solution."
