    "## Question 6.2\n",
    "### 2. Use a CUSUM approach to make a judgment of whether Atlanta’s summer climate has gotten warmer in that time (and if so, when).\n",
    "\n",
    "We're going to repeat the CUMSUM model that we did for the average daily data but now using the average yearly temperature and average yearly standard deviation."
