    "Both plotting the average yearly temperature and our model show that Atlanta's summer climate has gotten warmer, around index 15 which equates to ~2010 according to our graphp and then index 17 according to our model which equates to 2012. I'm happy to find that my model came up with a solution similar to NASA who found that the continental U.S. endured its warmest year on record by far in 2012 , according to NOAA, the official keeper of U.S. weather records. Please feel free to read more here: \n",
